import gsap from "gsap";

export default function Contact() {
  return (
    <div className="contact">
      <div className="contact-wrapper">
        <form action="" method="POST" className="form">
          <input
            className="input"
            type="text"
            name="email"
            placeholder="Email"
          ></input>
          <span className="space"></span>
          <input
            className="input"
            type="text"
            name="Name"
            placeholder="Name"
          ></input>
          <span className="space"></span>
          <textarea
            className="input"
            type="text"
            name="Massege"
            rows="4"
            cols="23"
            placeholder="Message"
          ></textarea>
        </form>
        <div className="contact-p">
          <p>Name: Welid Labidi</p>
          <p>
            Email:
            <a href="mailto:welidlabidi@gmail.com">Welidlabidi@gmail.com</a>
          </p>
          <a href="https://github.com/welidlabidi">
            <i className="fa fa-github"></i>
          </a>
          <span className="space"></span>
          <a href="https://www.linkedin.com/in/welid-labidi-086041187/">
            <i className="fa fa-linkedin-square"></i>
          </a>
          <span className="space"></span>
          <a href="mailto:welidlabidi@gmail.com">
            <i className="fa fa-envelope"></i>
          </a>
        </div>
      </div>
      <style jsx>{`
        a,
        a:link {
          text-decoration: none;
          color: black;
        }
        .contact-wrapper {
          width: 800px;
          height: 400px;
          position: absolute;
          background-color: rgb(145, 139, 139);
          transform: translate(170%, -80%);
          opacity: 0.5;
          border-radius: 50px;
          /* display: none; */
        }
        .form {
          position: relative;
          width: 40%;
          margin-left: 20px;
          margin-top: 100px;
          display: flex;
          flex-direction: column;
        }
        .input {
          border: none;
          border-radius: 5px;
          background: rgb(199, 196, 196);
        }

        .contact-p {
          position: fixed;
          transform: translate(250%, -155%);
          color: white;
          z-index: 1000;
        }
        .space {
          padding: 10px;
        }
        .fa.fa-github {
          color: rgb(100, 97, 97);
          font-size: 30px;
        }
        .fa.fa-linkedin-square {
          color: rgb(104, 199, 236);
          font-size: 30px;
        }
        .fa.fa-envelope {
          color: rgb(233, 51, 51);
          font-size: 30px;
        }
      `}</style>
    </div>
  );
}
